function getpreviousornextresults(result_id,leftorright){
var announcement_id=$('#announcement_id_for_previousornextresult'+result_id).val();
var result_date=$('#result_date_for_previousornextresult'+result_id).val();
var ampmtype=$('#ampm_type_for_previousornextresult'+result_id).val();
$.ajax({
    url:base_url+"index.php/frontresult/getnextorpreviousresults",
    type:"POST",
    data:"announcement_id="+announcement_id+"&result_date="+result_date+"&leftorright="+leftorright,
    dataType:'json',
    success:function(msg)
    {
        if(leftorright=='left')
        {
           var thechagingresultno='<li class="mid"><strong>'+ampmtype+'</strong></li>';
        var result_num = msg['left']['result_num'];
      
      
      var resultnumarray = result_num.split('/');
                            for(var i=0;i<resultnumarray.length;i++)
                            {
                               thechagingresultno+= '<li class="ball">'+resultnumarray[i]+'</li>' ;
                            }
                            $('#theresultnumbercircles'+result_id).html(thechagingresultno);
                              $('#theresultdateandtime'+result_id).html(' Result for: '+msg['left']['result_date']);
                              $('#result_date_for_previousornextresult'+result_id).val(msg['left']['result_date']);  
        
         if(msg['right']['result_num']==0){
          $('#nextresultlink'+result_id).html('');
          
        }
        else 
        {
        $('#nextresultlink'+result_id).html('<a  href="javascript:getpreviousornextresults(\''+result_id+'\',\'right\')"  ><i class="fa fa-angle-double-right"></i></a>');

        }
            if(msg['nextleft']['result_num']==0){
         
         
            $('#previousresultlink'+result_id).html(''); 
        }
        else 
        {
         $('#previousresultlink'+result_id).html('<a  href="javascript:getpreviousornextresults(\''+result_id+'\',\'left\')"  ><i class="fa fa-angle-double-left"></i></a>');
      
        }
        }
        else  
        {
         var thechagingresultno='<li class="mid"><strong>'+ampmtype+'</strong></li>';
        var result_num = msg['right']['result_num'];
      
      
      var resultnumarray = result_num.split('/');
                            for(var i=0;i<resultnumarray.length;i++)
                            {
                               thechagingresultno+= '<li class="ball">'+resultnumarray[i]+'</li>' ;
                            }
                            $('#theresultnumbercircles'+result_id).html(thechagingresultno);
                              $('#theresultdateandtime'+result_id).html(' Result for: '+msg['right']['result_date']);
                              $('#result_date_for_previousornextresult'+result_id).val(msg['right']['result_date']);  
         
         if(msg['nextright']['result_num']==0){
          $('#nextresultlink'+result_id).html('');
          
        }
        else 
        {
        $('#nextresultlink'+result_id).html('<a  href="javascript:getpreviousornextresults(\''+result_id+'\',\'right\')"  ><i class="fa fa-angle-double-right"></i></a>');

        }
         if(msg['left']['result_num']==0){
         
         
            $('#previousresultlink'+result_id).html(''); 
        }
        else 
        {
         $('#previousresultlink'+result_id).html('<a  href="javascript:getpreviousornextresults(\''+result_id+'\',\'left\')"  ><i class="fa fa-angle-double-left"></i></a>');
      
        }
        
        }
        
     
       
    },
    error:function(){
        iosOverlay(
                {
                    text:"Error!",
            duration:2e3,
            icon:base_url+"resource/iosoverlay/img/cross.png"
        })
        ,$("img").css("width","50%")
    }
})
}

